import React from "react";
import { StyleSheet, css } from "aphrodite";
import { Link } from "react-router-dom";

const Header = () => {
	return (
		<div className={css(classes.header)}>
			<Link className={css(classes.headerComp)} value='home' to="/">
				HOME
			</Link>
			<Link className={css(classes.headerComp)} value='works' to="/works">
				WORKS
			</Link>
			<Link className={css(classes.headerComp)} value='' to="/services">
				SERVICES
			</Link>
			<Link className={css(classes.headerComp)} to="/contact">
				CONTACT
			</Link>
			<Link className={css(classes.headerComp)} to="/about">
				ABOUT
			</Link>
		</div>
	);
};

const classes = StyleSheet.create({
	header: {
		display: "flex",
		flexDirection: "row",
		justifyContent: "space-evenly",
		color: "#585858",
		backgroundColor: "#1C1B1B",
		padding: 70,
		paddingLeft: "37%",
		paddingRight: "37%",
		textDecoration: "none",

		// position: 'absolute',
	},
	headerComp: {
		fontWeight: 500,
		fontSize: 18,
		textDecoration: "none",
		color: "#585858",
	},
});

export default Header;
